import React from 'react'
import { AppBar, Typography } from '@material-ui/core'
import useStyles from './styles'
import memories from '../../images/pandabnw_p.png'

const Navbar = () => {
    const classes = useStyles();
    return (
        <AppBar className={classes.appBar} position="static" color="inherit">
            <div className={classes.brandContainer}>
            <Typography component={Link} className={classes.heading} variant="h2" align="center">PANda 3</Typography>
            <img className={classes.image} src={memories} alt="memories" height="100" width="100" />
            </div>
        </AppBar>
    );
}

export default Navbar;
